// ── NAVIGATION ────────────────────────────────────────────────
function initNav() {
  const nav       = document.getElementById("navbar");
  const hamburger = document.getElementById("hamburger");
  const menu      = document.getElementById("nav-menu");

  if (!nav || !hamburger || !menu) return;

  // Scroll shadow
  window.addEventListener("scroll", () => {
    nav.classList.toggle("scrolled", window.scrollY > 50);
  });

  // Hamburger toggle
  hamburger.addEventListener("click", () => {
    const isOpen = !menu.classList.contains("open");
    if (isOpen) {
      menu.classList.add("open");
      hamburger.classList.add("open");
      document.body.style.overflow = "hidden";
    } else {
      menu.classList.remove("open");
      hamburger.classList.remove("open");
      document.body.style.overflow = "";
    }
  });

  // Fermer au clic sur lien
  menu.querySelectorAll("a").forEach(a => {
    a.addEventListener("click", () => {
      menu.classList.remove("open");
      hamburger.classList.remove("open");
      document.body.style.overflow = "";
    });
  });

  // Fermer avec Echap
  document.addEventListener("keydown", e => {
    if (e.key === "Escape") {
      menu.classList.remove("open");
      hamburger.classList.remove("open");
      document.body.style.overflow = "";
    }
  });
}



// Fermer menu (appelé depuis HTML)
function closeMenu() {
  const hamburger = document.getElementById("hamburger");
  const menu = document.getElementById("nav-menu");
  if (hamburger) hamburger.classList.remove("open");
  if (menu) menu.classList.remove("open");
}

// ── ANIMATION NOM (lettre par lettre) ─────────────────────────
function animateName() {
  const line1El = document.getElementById("name-line1");
  const line2El = document.getElementById("name-line2");
  if (!line1El || !line2El) return;

  const line1 = "NAMBININTSOA";
  const line2 = "Tsiky Fanantenana";

  function buildLetters(text, baseDelay) {
    return text.split("").map((ch, i) => {
      const sp = document.createElement("span");
      sp.classList.add("letter");
      sp.textContent = ch === " " ? "\u00A0" : ch;
      sp.style.animationDelay = (baseDelay + i * 0.06) + "s";
      return sp;
    });
  }

  buildLetters(line1, 0.3).forEach(s => line1El.appendChild(s));
  buildLetters(line2, 0.3 + line1.length * 0.06 + 0.1).forEach(s => line2El.appendChild(s));
}

